package com.example.store_online.data_models;public class AccountInformation {    private String gender;    private String nickname;    private String birthday;    public AccountInformation() {    }    public AccountInformation(String gender, String nickname, String birthday) {        this.gender = gender;        this.nickname = nickname;        this.birthday = birthday;    }    public String getGender() {        return gender;    }    public void setGender(String gender) {        this.gender = gender;    }    public String getNickname() {        return nickname;    }    public void setNickname(String nickname) {        this.nickname = nickname;    }    public String getBirthday() {        return birthday;    }    public void setBirthday(String birthday) {        this.birthday = birthday;    }}